import React from 'react';
import { Button } from '@material-ui/core';

import { NextLink } from './NextLink'

export const DesktopMenu = ({ list }) => {
  return (
    <div>
      {list.map(item => (
        <NextLink href={item.href}>
          <a color="inherit">{item.title}</a>
        </NextLink>
      ))}
    </div>
  );
};
